import React, { useEffect, useState } from "react";
import axios from "axios";
import { PieChart, Pie, Cell, Tooltip, Legend } from "recharts";

const LogAnalyzer = () => {
  const [logs, setLogs] = useState([]);
  const [sqlInjectionLogs, setSqlInjectionLogs] = useState([]);
  const [unauthorizedAccessLogs, setUnauthorizedAccessLogs] = useState([]);

  // Fetch logs from API
  useEffect(() => {
    axios
      .get("http://localhost:5000/api/logs")
      .then((response) => {
        console.log("âœ… Fetched logs:", response.data);
        setLogs(response.data);
        filterLogs(response.data);
      })
      .catch((error) => console.error("âŒ Error fetching logs:", error));
  }, []);

  // Function to filter logs
  const filterLogs = (logs) => {
    console.log("ðŸ”Ž Filtering logs:", logs);

    const sqlLogs = logs.filter((log) => log.attackType === "SQL Injection");
    const unauthorizedLogs = logs.filter((log) => log.attackType === "Unauthorized Access");

    console.log("ðŸ“Œ SQL Injection Logs:", sqlLogs);
    console.log("ðŸš« Unauthorized Access Logs:", unauthorizedLogs);

    setSqlInjectionLogs(sqlLogs);
    setUnauthorizedAccessLogs(unauthorizedLogs);
  };

  // Check if logs are empty
  if (logs.length === 0) {
    return <h2>Loading logs...</h2>;
  }

  // Pie chart data
  const pieData = [
    { name: "SQL Injection", value: sqlInjectionLogs.length },
    { name: "Unauthorized Access", value: unauthorizedAccessLogs.length },
  ];

  const COLORS = ["#0088FE", "#FF8042"];

  return (
    <div className="container">
      <h1>Log Analyzer Dashboard</h1>

      <div className="chart-container">
        <PieChart width={400} height={400}>
          <Pie
            data={pieData}
            cx="50%"
            cy="50%"
            outerRadius={150}
            fill="#8884d8"
            dataKey="value"
            label
          >
            {pieData.map((entry, index) => (
              <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
            ))}
          </Pie>
          <Tooltip />
          <Legend />
        </PieChart>
      </div>

      <h2>SQL Injection Logs</h2>
      {sqlInjectionLogs.length > 0 ? (
        <table>
          <thead>
            <tr>
              <th>IP Address</th>
              <th>Timestamp</th>
              <th>Attack Type</th>
            </tr>
          </thead>
          <tbody>
            {sqlInjectionLogs.map((log, index) => (
              <tr key={index}>
                <td>{log.ipAddress}</td>
                <td>{new Date(log.timestamp).toLocaleString()}</td>
                <td>{log.attackType}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No SQL Injection logs found.</p>
      )}

      <h2>Unauthorized Access Logs</h2>
      {unauthorizedAccessLogs.length > 0 ? (
        <table>
          <thead>
            <tr>
              <th>IP Address</th>
              <th>Timestamp</th>
              <th>Attack Type</th>
            </tr>
          </thead>
          <tbody>
            {unauthorizedAccessLogs.map((log, index) => (
              <tr key={index}>
                <td>{log.ipAddress}</td>
                <td>{new Date(log.timestamp).toLocaleString()}</td>
                <td>{log.attackType}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No Unauthorized Access logs found.</p>
      )}
    </div>
  );
};

export default LogAnalyzer;
